import logo from './logo.svg';
import './App.css';
import { BrowserRouter } from 'react-router-dom';
import Home from './container/home/home';

const App = () => {
  return (
    <BrowserRouter>
      <div className="App">
      <text>"Hello"</text>
      {Home}
      </div>
    </BrowserRouter>
  );
}

export default App;
